Here is a basic example of an accounting system with General Ledger, Daily Journal, and Income Statement features using PHP and MySQL:

**Note:** This is a simplified version and not intended to be used in production without proper testing, validation, and security measures.

**Database Schema**
```sql
CREATE TABLE accounts (
  id INT PRIMARY KEY AUTO_INCREMENT,
  name VARCHAR(255) NOT NULL,
  type ENUM('Asset', 'Liability', 'Equity', 'Revenue', 'Expense') NOT NULL
);

CREATE TABLE journals (
  id INT PRIMARY KEY AUTO_INCREMENT,
  date DATE NOT NULL,
  account_id INT NOT NULL,
  debit DECIMAL(10,2),
  credit DECIMAL(10,2),
  description TEXT,
  FOREIGN KEY (account_id) REFERENCES accounts(id)
);

CREATE TABLE general_ledger (
  id INT PRIMARY KEY AUTO_INCREMENT,
  account_id INT NOT NULL,
  debit DECIMAL(10,2),
  credit DECIMAL(10,2),
  balance DECIMAL(10,2),
  timestamp TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  FOREIGN KEY (account_id) REFERENCES accounts(id)
);
```
**PHP Program**
```php
// database.php
<?php
define("DB_HOST", "localhost");
define("DB_USERNAME", "your_username");
define("DB_PASSWORD", "your_password");
define("DB_NAME", "accounting_system");

$conn = new mysqli(DB_HOST, DB_USERNAME, DB_PASSWORD, DB_NAME);

if ($conn->connect_error) {
    die("Connection failed: ". $conn->connect_error);
}

function getAccounts() {
    global $conn;
    $query = "SELECT * FROM accounts";
    $result = $conn->query($query);
    while ($row = $result->fetch_assoc()) {
        $accounts[] = $row;
    }
    return $accounts;
}

function getJournalEntries() {
    global $conn;
    $query = "SELECT * FROM journals ORDER BY date DESC";
    $result = $conn->query($query);
    while ($row = $result->fetch_assoc()) {
        $journals[] = $row;
    }
    return $journals;
}

function postJournalEntry($date, $accountId, $debit, $credit, $description) {
    global $conn;
    $query = "INSERT INTO journals (date, account_id, debit, credit, description) VALUES (?,?,?,?,?)";
    $stmt = $conn->prepare($query);
    $stmt->bind_param("siidss", $date, $accountId, $debit, $credit, $description);
    $stmt->execute();
}

function getGeneralLedger($accountId) {
    global $conn;
    $query = "SELECT * FROM general_ledger WHERE account_id =?";
    $stmt = $conn->prepare($query);
    $stmt->bind_param("i", $accountId);
    $stmt->execute();
    $result = $stmt->get_result();
    while ($row = $result->fetch_assoc()) {
        $generalLedger[] = $row;
    }
    return $generalLedger;
}

function updateBalance($accountId, $balance) {
    global $conn;
    $query = "UPDATE general_ledger SET balance =? WHERE account_id =?";
    $stmt = $conn->prepare($query);
    $stmt->bind_param("di", $balance, $accountId);
    $stmt->execute();
}
?>

